(1, 500, 2, 0, 50020, '500-2/0', 'Após prazo previsto no paragrafo anterior. não havendo a identificação do infrator e sendo o veiculo de propriedade de pessoa juridica. será lavrada nova multa ao proprietário do veiculo, mantida a originada pela infração', 'Art. 111', 'Jurídica', 'LEVE', 3, '53.2000', '42.5600', '2.1280', '88.3800', '70.7040', '3.5352', 'Decido pelo INDEFERIMENTO da DEFESA e, por conseguinte, pela PROCEDÊNCIA e SUBSISTÊNCIA do auto e determino aplicação da pena de multa pela infração em questão com base no Art. 181º, XX, do Código de Trânsito Brasileiro.'),
(2, 501, 0, 0, 50100, '501-0/0', 'DIRIGIR SEM POSSUIR CNH/PPD/ACCOU PERMISSAO PARA DIRIGIR', 'Art. 162 I', 'Condutor', 'GRAVISSIMA', 7, '574.6200', '459.6960', '22.9848', '880.4100', '704.3280', '35.2164', ''),
